        <div>
              <div id="login-form-wrap">
  <h2> Sign Up </h2>
  <form id="login-form">
    <p>
   <input onChange={(e)=> setemail(e.target.value) }
   value={ email}

       type="email" 
       id="input"
        name="email"
         placeholder="email" 
         required /> 
         <i className="validation"><span /><span /></i>
