      id="input"
       name="password"
        placeholder="Password"
         required />
         <i className="validation"><span /><span /></i>


    </p>
    <p>
      <input 
      type="submit" 
      id="Sign Up" 
      defaultValue="Sign Up" > Signup  </input>
    </p>
  </form>

  <Link to='/signin'>


  <div id="create-account-wrap">
    <p> Already have an account? <a href="#f">Sign In</a></p><p>
    </p></div>
 </Link>
</div>
        </div>
    )
}

export default Register ;
